(function () {
  function editableWorkspaceDialog(workspaces, localePath) {
    var canSelect = workspaces.length;
    var canCreate = scrivito.UserPermissions.can('create_workspace');

    var localePrefix = 'editable_ws_dialog.' + localePath;

    var view = $(scrivito.Template.render('editable_workspace_dialog', {
      workspaces: workspaces,
      can_select: canSelect,
      can_create: canCreate,
      can_select_or_create: canSelect || canCreate,
      title: translatePrefix(localePrefix + '.title', canSelect, canCreate),
      description: translatePrefix(localePrefix + '.description', canSelect, canCreate)
    }));

    $('#scrivito_editing').append(view);

    var createNewWs = false;

    view.on('focus click', '.scrivito_input_list_of_ws', function () {
      createNewWs = false;
      view.find('.scrivito_confirm').html(scrivito.t('editable_ws_dialog.select'));
      view.find('.scrivito_disabled').removeClass('scrivito_disabled');
      view.find('.scrivito_input_new_ws_name label, .scrivito_input_new_ws_name input').addClass('scrivito_disabled');
    });

    view.on('focus click', '.scrivito_input_new_ws_name', function () {
      createNewWs = true;
      view.find('.scrivito_confirm').html(scrivito.t('menu_bar.create'));
      view.find('.scrivito_disabled').removeClass('scrivito_disabled');
      view.find('.scrivito_input_list_of_ws label, .scrivito_input_list_of_ws select').addClass('scrivito_disabled');
    });

    var deferred = new scrivito.Deferred();

    function confirmAction() {
      if (createNewWs) {
        createWorkspace();
      } else {
        selectWorkspace();
      }
      return false;
    }

    function createWorkspace() {
      var title = $('#scrivito_new_ws_name').val();
      scrivito.dialog.close_with_transition(view);

      scrivito.withSavingOverlay(scrivito.Workspace.createAsync(title)).then(function (_ref) {
        var id = _ref.id;
        return deferred.resolve(id);
      })['catch'](function (error) {
        scrivito.handleAjaxError(error);
        deferred.reject();
      });
    }

    function selectWorkspace() {
      var wsId = $('select#scrivito_list_of_ws').val();
      scrivito.dialog.close_with_transition(view);
      deferred.resolve(wsId);
    }

    function cancelAction() {
      scrivito.dialog.close_with_transition(view);
      deferred.reject();
      return false;
    }

    view.find('.scrivito_confirm').on('click', confirmAction);
    view.find('.scrivito_cancel').on('click', cancelAction);

    scrivito.dialog.open_and_center_with_transition(view);

    if (canSelect) {
      view.find('.scrivito_input_list_of_ws').click();
      view.find('#scrivito_list_of_ws').focus();
    } else if (canCreate) {
      view.find('.scrivito_input_new_ws_name').click();
      view.find('#scrivito_new_ws_name').focus();
    }

    return scrivito.withDialogBehaviour(view, deferred.promise, {
      enter: confirmAction,
      escape: cancelAction
    });
  }

  function translatePrefix(prefix, canSelect, canCreate) {
    if (canSelect && canCreate) {
      return scrivito.t(prefix + '.select_or_create');
    }
    if (canSelect) {
      return scrivito.t(prefix + '.select');
    }
    if (canCreate) {
      return scrivito.t(prefix + '.create');
    }
    return scrivito.t(prefix + '.forbidden');
  }

  scrivito.editableWorkspaceDialog = editableWorkspaceDialog;
})();
